const Div = ({ padding, dataResponse, num }) => {
    const data = dataResponse.obj[num]
  return (
    <div>
      <div key={data.weather}>Tiempo: {data.weather}</div>
      {data.icon ? (
        <div key={data.icon}>
          <img
            src={`http://openweathermap.org/img/wn/${data.icon}@2x.png`}
          />
        </div>
      ) : null}
      <div key={data.temp} style={{ padding: padding }}>Temperatura: {data.temp}</div>
      <div key={data.feels_like} style={{ padding: padding }}>
        Sensación Térmica: {data.feels_like}
      </div>
      <div key={data.temp_min} style={{ padding: padding }}>
        Temperatura Mínima: {data.temp_min}
      </div>
      <div key={data.temp_max} style={{ padding: padding }}>
        Temperatura Máxima: {data.temp_max}
      </div>
      <div key={data.pressure} style={{ padding: padding }}>Presión: {data.pressure}</div>
      <div key={data.humidity} style={{ padding: padding }}>Humedad: {data.humidity}</div>
      <div key={data.visibility} style={{ padding: padding }}>Visibilidad: {data.visibility}</div>
      <div key={data.windSpeed} style={{ padding: padding }}>
        Velocidad de viento: {data.windSpeed}
      </div>
      <div key={data.data.sunrise} style={{ padding: padding }}>Amanecer: {data.sunrise}</div>
      <div key={data.sunset} style={{ padding: padding }}>Atardecer: {data.sunset}</div>
    </div>
  );
};

export default Div
